import React from "react";
import 'bootstrap/dist/css/bootstrap.css';

export default function FundraisingProject() {
    return (
        <li>
            <div className="row">
                <div className="fpTitle">Title</div>
                <div className="fpDesc">Description</div>
                <div className="fpFounder">Founder</div>
                <div className="fpGoal">Goal</div>
                <div className="fpDueData">DueDate</div>
                <div className="fpCurrent">Current balance</div>
                <div className="fpTags">Tags</div>
            </div>
        </li>
    )
}
